import React, { useState } from "react";
import {
  KeyboardDatePicker,
  MuiPickersUtilsProvider
} from "@material-ui/pickers";
import MomentUtils from "@date-io/moment";
import "moment/locale/ru";
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import "../dtpic/dtpic.css"

import Datatab from "../datatab/datatab"

const click = () => {
  console.log('http://localhost:62499/api/zplist/'+document.getElementById('start').value + '-' + document.getElementById('end').value)
}

class Dtpic extends React.Component {
  render(){
    const click=()=>{
      console.log ('Нажал')
    }
    return (
      <div className="botmarg">
        <Grid container spacing={3}>
          <Grid item xs>
            <MuiPickersUtilsProvider locale="ru" utils={MomentUtils}>
              <KeyboardDatePicker
                id="start"
                name="start"
                label="From"
                format="YYYY-MM-DD"
                autoOk
                //value={selectedDate.start}
                variant="inline"
                //onChange={handleChange("start")}
  
              />
              <KeyboardDatePicker
                id="end"
                name="end"
                label="To"
                format="YYYY-MM-DD"
                autoOk
                //value={selectedDate.end}
                variant="inline"
                //onChange={handleChange("end")}
              />
            </MuiPickersUtilsProvider>
          </Grid>
          <Grid  item xs>
            <Button  onClick={click} variant="contained" color="secondary" >
              Получить
            </Button>
          </Grid>
          <Grid item xs>
  
          </Grid>
        </Grid>
  
       
  
 
  
  
      </div>
    );
  }
}

export default Dtpic;
